# 70 "freebsd5/crypto/blowfish/bf_skey.c" 2

void
BF_set_key(key, len, data)
 BF_KEY *key;
 int len;
 unsigned char *data;
{
 int i;
 u_int32_t *p, ri, in[2];
 unsigned char *d, *end;

 memcpy((char *)key, (const char *)&global_bf_init[get_stack_id()], sizeof(BF_KEY));
 p = key->P;

 if (len > ((16 + 2) * 4))
  len = (16 + 2) * 4;

 d = data;
 end= &(data[len]);
 for (i = 0; i < 16 + 2; i++) {
  ri = *(d++);
  if (d >= end) d = data;

  ri <<= 8;
  ri |= *(d++);
  if (d >= end) d = data;

  ri <<= 8;
  ri |= *(d++);
  if (d >= end) d = data;

  ri <<= 8;
  ri |= *(d++);
  if (d >= end) d = data;

  p[i] ^= ri;
 }

 in[0] = 0L;
 in[1] = 0L;
 for (i = 0; i < 16 + 2; i += 2) {
  BF_encrypt(in, key);
  p[i ] = in[0];
  p[i+1] = in[1];
 }

 p = key->S;
 for (i = 0; i < 4 * 256; i += 2) {
  BF_encrypt(in, key);
  p[i ] = in[0];
  p[i+1] = in[1];
 }
}

